[[questions]]
id = "PAV267"
question = "Vad bör kompetensutvecklingen för lärare som undervisar minoritetselever i matematik inkludera?"
answer = "Förutom matematik och matematikdidaktik måste kunskaper om språkets betydelse för utvecklingen av matematiska begrepp, om andraspråksutveckling och vad som händer, eller kan hända, i möten mellan människor med olika kulturell bakgrund ingå"
